import React, { Component } from "react";
import Loading from "../components/Loading";

export default class Servicos extends Component {
    render() {
        return (
            <div style={{
                height: "70vh"
            }}>
                <h1>Coming Soon...</h1>
                <div class="dot-spinner">
                    <div class="dot-spinner__dot"></div>
                    <div class="dot-spinner__dot"></div>
                    <div class="dot-spinner__dot"></div>
                    <div class="dot-spinner__dot"></div>
                    <div class="dot-spinner__dot"></div>
                    <div class="dot-spinner__dot"></div>
                    <div class="dot-spinner__dot"></div>
                    <div class="dot-spinner__dot"></div>
                </div>
            </div>
        )
    }
}
